    true,nt"url": null,nt"notes": "The INSPTRAX System tracks Air, RCRA, and
    Water inspection targeting, planning and tracking information. It is used by the
    the Air, RCRA, and Water programs to input annual inspection targets, then used
    by the Region to send a list of draft and final targets to Region 7 four states
    (Iowa, Kansas, Missouri, Nebraska). It is then used to generate quarterly inspection
    schedules for conducting the actural inspection activities by our ENSV inspectors
    and finally used to track all inspection activities.",nt"license_title": "Other
